Wizards of Waverly Place: The Movie (2009)  

Verenigde Staten
Avontuur / Familie
98 minuten

geregisseerd door Lev L. Spiro
met Selena Gomez, David Henrie en Jake T. Austin

Alex Russo (Selena Gomez) gaat met haar familie op vakantie naar de plek waar haar ouders elkaar voor het eerst ontmoette. Ze krijgt ruzie met haar moeder en wenst dat haar ouders elkaar nooit ontmoet hadden. Door haar toverkrachten komt dit uit. Ze moet daarom met haar broer (David Henrie) op zoek naar de steen der dromen die daar in de buurt is verborgen om deze spreuk te verbreken.


